import logoImg from '../../assets/logo.svg'
import { Container } from './styles'



export function Header() {
  return (
    <Container>
      <Content>
      <img src={logoImg} alt="dt money" />
      <button type="button">New transaction</button>
      </Content>
    </Container>
  )
}
